// src/submit.js

const submitPipeline = (nodes, edges) => {
  // Processing logic for submitting nodes and edges
  console.log('Submitting pipeline with nodes:', nodes);
  console.log('Submitting pipeline with edges:', edges);

  // Add your pipeline submission logic here
};

export const SubmitButton = ({ nodes, edges }) => {
  return (
    <button
      onClick={() => submitPipeline(nodes, edges)}
      style={{
        position: 'absolute',
        bottom: '20px',
        right: '20px',
        padding: '10px 20px',
        backgroundColor: '#007bff',
        color: 'white',
        border: 'none',
        borderRadius: '5px',
        cursor: 'pointer',
      }}
    >
      Submit Pipeline
    </button>
  );
};
